import axios from 'axios';
import React, { useState, useEffect } from 'react';

const DogWalkersList = () => {
  const [dogWalkers, setDogWalkers] = useState([]);
  useEffect(() => {
    getDogWalkers();
  }, []);
  const getDogWalkers = () => {
    axios.get('/api/dogWalkers')
    .then((res) => {
      console.log(res);
      setDogWalkers(res.data);
    })
    .catch((err) => {
      console.log(err);
    });
  };
  return(
    <div>
      <h1>Dog Walkers</h1>
      <div className='dogWalkers-container'>
      {dogWalkers.map((dogWalker) => (
        <div className='walker' key={dogWalker.id}>
          <h3>{dogWalker.name}</h3>
          <p>{dogWalker.usr_info}</p>
        </div>
        ))}
      </div>
    </div>
    );
};
export default DogWalkersList;
